import React from "react";

function Interface({ handleInterface, status, language }) {
  const buttonLabels = {
    en: {
      create: 'Create',
      validate: 'Validate',
      solve: 'Solve',
      clear: 'Clear',
    },
    jp: {
      create: '作成',
      validate: '検証',
      solve: '解決',
      clear: 'クリア',
    }
  };

  // Fallback to English if language is not defined in buttonLabels
  const labels = buttonLabels[language] || buttonLabels.en;

  return (
    <div className="interface">
      <div className="info-interface">
        <input readOnly value={status}></input>
      </div>
      <div className="action-interface">
        <button
          className="generator-btn btn"
          onClick={() => handleInterface("create")}
        >
          {labels.create}
        </button>
        <button
          className="validate-btn btn"
          onClick={() => handleInterface("validate")}
        >
          {labels.validate}
        </button>
        <button
          className="solve-btn btn"
          onClick={() => handleInterface("solve")}
        >
          {labels.solve}
        </button>
        <button
          className="clear-btn btn"
          onClick={() => handleInterface("clear")}
        >
          {labels.clear}
        </button>
      </div>
    </div>
  );
}

export default Interface;
